script: |
  super -f text -I q9932.spq | sort > q9932.out

inputs:
  - name: q9932.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 * col2 BETWEEN - + col0 AND + 36 * + col2 / - col2 + + col1 * - col0 + + 90;
  - name: tab2

outputs:
  - name: q9932.out
    data: |
      46	51	23
      64	77	40
      75	67	58
